        protected void LiveScoreTreeView_SelectedNodeChanged(object sender, EventArgs e)
        {
            var tv = sender as TreeView;
            var tn = tv.SelectedNode;
            if (tn.Checked)
            {
                foreach (TreeNode tnCn in tn.ChildNodes)
                {
                    tnCn.Checked = false;
                }
                tn.Checked = false;
                tn.Collapse();
            }
            else
            {
                var tparent = tn.Parent;
                if (tparent != null)
                {
                    tparent.Checked = true;
                }
                tn.Checked = true;
                tn.Expand();
            }
            tn.Selected = false;
        }

        private static void CheckAndExpandNodes(TreeNodeCollection nodes, ref List<Livescores> usersLivescores)
        {
            for (int i = 0; i < nodes.Count; i++)
            {
                var currentNode = nodes[i];
                currentNode.SelectAction = TreeNodeSelectAction.SelectExpand;
                var nodeElements = currentNode.Value.Split('|');
                var sport = "";
                var competition = "";
                var level = "";
                var isChecked = false;
                try
                {
                    switch (nodeElements[1])
                    {
                        case "SPORT":
                            sport = nodeElements[2];
                            var matchUls = usersLivescores.FirstOrDefault(l => l.sport.ToUpper() == sport.ToUpper());
                            if (matchUls != null)
                            {
                                isChecked = true;
                            }
                            break;
                        case "COMPETITION":
                            sport = nodeElements[2];
                            competition = nodeElements[3];
                            var matchUlc = usersLivescores.FirstOrDefault(l => l.sport.ToUpper() == sport.ToUpper() & l.competition.ToUpper() == competition.ToUpper());
                            if (matchUlc != null)
                            {
                                isChecked = true;
                            }
                            break;
                        case "LEVEL":
                            sport = nodeElements[2];
                            competition = nodeElements[3];
                            level = nodeElements[4];
                            var matchUll = usersLivescores.FirstOrDefault(l => l.sport.ToUpper() == sport.ToUpper() & l.competition.ToUpper() == competition.ToUpper() & l.level.ToUpper() == level.ToUpper());
                            if (matchUll != null)
                            {
                                isChecked = true;
                            }
                            break;
                        default:
                            break;
                    }
                }
                catch (Exception)
                {
                }
                currentNode.Checked = isChecked;
                currentNode.Expanded = false;
                if (nodes[i].ChildNodes.Count > 0)
                {
                    CheckAndExpandNodes(nodes[i].ChildNodes, ref usersLivescores);
                }
            }
        }

        private void UpdateLivescores(Users user, TreeNodeCollection tnc, NewsToEmailDBEntities context)
        {
            var dBUsersLivescores = context.Users.Find(user.id).Livescores;
            var greenlist = new List<Livescores>();
            foreach (TreeNode ls in tnc)
            {
                var lsComponents = ls.Value.Trim('|').Split('|').ToList();
                var cbLivescore = GetLivescore(ls);
                cbLivescore.usersId = user.id;
                //cbLivescore.Users = user;
                var lsCategory = lsComponents[0];
                var sportL = "";
                var competitionL = "";
                var levelL = "";
                Livescores liveScoreMatch = null;
                switch (lsCategory.ToUpper())
                {
                    case "SPORT":
                        sportL = lsComponents.Last().ToUpper();
                        liveScoreMatch = user.Livescores.FirstOrDefault(l => l.sport.ToUpper() == sportL);
                        break;
                    case "COMPETITION":
                        competitionL = lsComponents.Last().ToUpper();
                        sportL = lsComponents[lsComponents.LastIndexOf(competitionL) - 1].ToUpper();
                        liveScoreMatch = user.Livescores.FirstOrDefault(l => l.sport.ToUpper() == sportL & l.competition.ToUpper() == competitionL);
                        if (liveScoreMatch == null)
                        {
                            liveScoreMatch = user.Livescores.FirstOrDefault(l => l.sport.ToUpper() == sportL);
                            if (liveScoreMatch != null)
                            {
                                if (string.IsNullOrWhiteSpace(liveScoreMatch.competition))
                                {
                                    liveScoreMatch.competition = competitionL;
                                }
                                else
                                {
                                    liveScoreMatch = null;
                                }
                            }
                        }
                        break;
                    case "LEVEL":
                        levelL = lsComponents.Last();
                        competitionL = lsComponents[lsComponents.LastIndexOf(levelL) - 1].ToUpper();
                        sportL = lsComponents[lsComponents.LastIndexOf(competitionL) - 1].ToUpper();
                        liveScoreMatch = user.Livescores.FirstOrDefault(l => l.sport.ToUpper() == sportL & l.competition.ToUpper() == competitionL & l.level.ToUpper() == levelL.ToUpper());
                        if (liveScoreMatch == null)
                        {
                            liveScoreMatch = user.Livescores.FirstOrDefault(l => l.sport.ToUpper() == sportL & l.competition.ToUpper() == competitionL);
                            if (liveScoreMatch == null)
                            {
                                liveScoreMatch = user.Livescores.FirstOrDefault(l => l.sport.ToUpper() == sportL);
                                if (liveScoreMatch != null)
                                {
                                    if (string.IsNullOrWhiteSpace(liveScoreMatch.competition))
                                    {
                                        liveScoreMatch.level = levelL;
                                        liveScoreMatch.competition = competitionL;
                                    }
                                    else
                                    {
                                        liveScoreMatch = null;
                                    }
                                }
                            }
                            else
                            {
                                if (string.IsNullOrWhiteSpace(liveScoreMatch.level))
                                {
                                    liveScoreMatch.level = levelL;
                                }
                                else
                                {
                                    liveScoreMatch = null;
                                }
                            }
                        }
                        break;
                    default:
                        break;
                }
                if (liveScoreMatch == null)
                {
                    context.Livescores.Add(cbLivescore);
                }
                greenlist.Add(cbLivescore);
            }
            foreach (var dbl in dBUsersLivescores.ToList())
            {
                bool inList = false;
                foreach (var gL in greenlist)
                {
                    inList = gL.sport.ToUpper() == dbl.sport.ToUpper() & gL.competition.ToUpper() == dbl.competition.ToUpper() & gL.level.ToUpper() == dbl.level.ToUpper() & gL.usersId == dbl.usersId;
                    if (inList)
                    {
                        break;
                    }
                }
                if (!inList)
                {
                    context.Livescores.Remove(dbl);
                }
            }
            context.SaveChanges();
        }


        private Livescores GetLivescore(TreeNode ls)
        {
            var lsComponents = ls.Value.Trim('|').Split('|').ToList();
            var result = new Livescores();
            result.competition = "";
            result.level = "";
            result.sport = "";
            switch (lsComponents[0])
            {
                case "LEVEL":
                    result.level = lsComponents.Last();
                    result.competition = lsComponents[lsComponents.LastIndexOf(result.level) - 1].ToUpper();
                    result.sport = lsComponents[lsComponents.LastIndexOf(result.competition) - 1].ToUpper();
                    break;
                case "COMPETITION":
                    result.competition = lsComponents.Last().ToUpper();
                    result.sport = lsComponents[lsComponents.LastIndexOf(result.competition) - 1].ToUpper();
                    break;
                case "SPORT":
                    result.sport = lsComponents.Last().ToUpper();
                    break;
                default:
                    break;
            }
            return result;
        }

        protected void Button_Update_Click(object sender, EventArgs e)
        {
            var context = new NewsToEmailDBEntities();
            int id = (int)ViewState["CurrentUserId"];
            var user = context.Users.FirstOrDefault(u => u.id == id);
            UpdateLivescores(user, LiveScoresTV.CheckedNodes, context);
            BackToProfile();
        }


        protected void Button_Cancel_Click(object sender, EventArgs e)
        {
            BackToProfile();
        }

        private void BackToProfile()
        {
            string currentUserName = (string)ViewState["CurrentUserName"];
            int id = 0;
            if (User.Identity.Name == "didoeddy" & User.Identity.Name != currentUserName)
            {
                var userId = Request.QueryString["id"];
                if (userId != null)
                {
                    id = int.Parse(userId);
                }
            }
            if (id > 0)
            {
                Response.Redirect("~/Profile.aspx?id="+id);
            }
            else
            {
                Response.Redirect("~/Profile");
            }
        }
    }
